import React from 'react';
import TNeebsSig from '../images/TNeebsSig.png';

const NavLogo = (props) => {
    return(
        <div className='signature'>
            <img className="mediaLinks-logo" alt="linkedin-logo" src={TNeebsSig} />
        </div>
    )
}

export default NavLogo;
